import collections

class Solution:
    def minCostToDeliverAll(self, n: int, k: int) -> int:
        s = collections.deque([str(n)])
        for i in range(n):
            s.appendleft(str(i))

        def dfs(s, i, path):
            if i == n:
                return 0

            if len(path) == k:
                return 1

            if s[i]!= path[-1]:
                return dfs(s, i+1, path+[s[i]])
            else:
                return dfs(s, i+1, path+[s[i]]) + 1

        return dfs(s, 0, [])


