        if n * m == 0:
            return -1
        seen = set()
        counter = 0
        for i in range(n):
            for j in range(m):
                if grid[i][j] == '*':
                    counter += 1
                    if i == 0 or i == n - 1 or j == 0 or j == m - 1:
