class Solution:
    def leftover(self, A, B, C, I, J, K):
        A,B,C = float(A), float(B), float(C)
        I,J,K = float(I), float(J), float(K)
        if I + J + K == 0:
            return 0
        return A * I * J * K / (I + J + K)

    def total_leftover(self, A, B, C, I, J, K):
        A = A * (1 + I)
        B = B * (1 + J)
        C = C * (1 + K)
        return A - B + C

